pub enum VMError {
    FunctionCallError(FunctionCallError),

    /// Serialized external error from External trait implementation.
    ExternalError(Vec<u8>),

    /// An error that is caused by an operation on an inconsistent state.
    /// E.g. an integer overflow by using a value from the given context.
    InconsistentStateError(InconsistentStateError),

    /// Error caused by caching.
    CacheError(CacheError),
}

pub enum FunctionCallError {

    /// Wasm compilation error
    CompilationError(CompilationError),

    /// Wasm binary env link error
    LinkError {
        msg: String,
    },

    /// Import/export resolve error
    MethodResolveError(MethodResolveError),

    /// A trap happened during execution of a binary
    WasmTrap(WasmTrap),
    WasmUnknownError,
    HostError(HostError),
    EvmError(EvmError),

    /// An error message when wasmer 1.0 returns a wasmer::RuntimeError
    WasmerRuntimeError(String),

    /// A trap in Wasmer 1.0, not same as WasmTrap above, String is a machine readable form like "stk_ovf"
    /// String is used instead of wasmer internal enum is because of BorshSerializable.
    /// It can be convert back by wasmer_vm::TrapCode::from_str
    Wasmer1Trap(String),
}

pub enum CacheError {
    ReadError,
    WriteError,
    DeserializationError,
    SerializationError {
        hash: [u8; ],
    },
}

pub enum WasmTrap {

    /// An `unreachable` opcode was executed.
    Unreachable,

    /// Call indirect incorrect signature trap.
    IncorrectCallIndirectSignature,

    /// Memory out of bounds trap.
    MemoryOutOfBounds,

    /// Call indirect out of bounds trap.
    CallIndirectOOB,

    /// An arithmetic exception, e.g. divided by zero.
    IllegalArithmetic,

    /// Misaligned atomic access trap.
    MisalignedAtomicAccess,

    /// Breakpoint trap.
    BreakpointTrap,

    /// Stack overflow.
    StackOverflow,

    /// Generic trap.
    GenericTrap,
}

pub enum MethodResolveError {
    MethodEmptyName,
    MethodNotFound,
    MethodInvalidSignature,
}

pub enum CompilationError {
    CodeDoesNotExist {
        account_id: String,
    },
    PrepareError(PrepareError),
    WasmerCompileError {
        msg: String,
    },
    UnsupportedCompiler {
        msg: String,
    },
}

pub enum PrepareError {

    /// Error happened while serializing the module.
    Serialization,

    /// Error happened while deserializing the module.
    Deserialization,

    /// Internal memory declaration has been found in the module.
    InternalMemoryDeclared,

    /// Gas instrumentation failed.
    ///
    /// This most likely indicates the module isn't valid.
    GasInstrumentation,

    /// Stack instrumentation failed.
    ///
    /// This  most likely indicates the module isn't valid.
    StackHeightInstrumentation,

    /// Error happened during instantiation.
    ///
    /// This might indicate that `start` function trapped, or module isn't
    /// instantiable and/or unlinkable.
    Instantiate,

    /// Error creating memory.
    Memory,
}

pub enum HostError {

    /// String encoding is bad UTF-16 sequence
    BadUTF16,

    /// String encoding is bad UTF-8 sequence
    BadUTF8,

    /// Exceeded the prepaid gas
    GasExceeded,

    /// Exceeded the maximum amount of gas allowed to burn per contract
    GasLimitExceeded,

    /// Exceeded the account balance
    BalanceExceeded,

    /// Tried to call an empty method name
    EmptyMethodName,

    /// Smart contract panicked
    GuestPanic {
        panic_msg: String,
    },

    /// IntegerOverflow happened during a contract execution
    IntegerOverflow,

    /// `promise_idx` does not correspond to existing promises
    InvalidPromiseIndex {
        promise_idx: u64,
    },

    /// Actions can only be appended to non-joint promise.
    CannotAppendActionToJointPromise,

    /// Returning joint promise is currently prohibited
    CannotReturnJointPromise,

    /// Accessed invalid promise result index
    InvalidPromiseResultIndex {
        result_idx: u64,
    },

    /// Accessed invalid register id
    InvalidRegisterId {
        register_id: u64,
    },

    /// Iterator `iterator_index` was invalidated after its creation by performing a mutable operation on trie
    IteratorWasInvalidated {
        iterator_index: u64,
    },

    /// Accessed memory outside the bounds
    MemoryAccessViolation,

    /// VM Logic returned an invalid receipt index
    InvalidReceiptIndex {
        receipt_index: u64,
    },

    /// Iterator index `iterator_index` does not exist
    InvalidIteratorIndex {
        iterator_index: u64,
    },

    /// VM Logic returned an invalid account id
    InvalidAccountId,

    /// VM Logic returned an invalid method name
    InvalidMethodName,

    /// VM Logic provided an invalid public key
    InvalidPublicKey,

    /// `method_name` is not allowed in view calls
    ProhibitedInView {
        method_name: String,
    },

    /// The total number of logs will exceed the limit.
    NumberOfLogsExceeded {
        limit: u64,
    },

    /// The storage key length exceeded the limit.
    KeyLengthExceeded {
        length: u64,
        limit: u64,
    },

    /// The storage value length exceeded the limit.
    ValueLengthExceeded {
        length: u64,
        limit: u64,
    },

    /// The total log length exceeded the limit.
    TotalLogLengthExceeded {
        length: u64,
        limit: u64,
    },

    /// The maximum number of promises within a FunctionCall exceeded the limit.
    NumberPromisesExceeded {
        number_of_promises: u64,
        limit: u64,
    },

    /// The maximum number of input data dependencies exceeded the limit.
    NumberInputDataDependenciesExceeded {
        number_of_input_data_dependencies: u64,
        limit: u64,
    },

    /// The returned value length exceeded the limit.
    ReturnedValueLengthExceeded {
        length: u64,
        limit: u64,
    },

    /// The contract size for DeployContract action exceeded the limit.
    ContractSizeExceeded {
        size: u64,
        limit: u64,
    },

    /// The host function was deprecated.
    Deprecated {
        method_name: String,
    },
}

pub enum EvmError {

    /// Contract not found.
    ContractNotFound,

    /// Fatal failure due conflicting addresses on contract deployment.
    DuplicateContract(
                      #[serde(with = "hex_format")]
                      Vec<u8>),

    /// Contract deployment failure.
    DeployFail(
               #[serde(with = "hex_format")]
               Vec<u8>),

    /// Contract execution failed, revert the state.
    Revert(
           #[serde(with = "hex_format")]
           Vec<u8>),

    /// Failed to parse arguments.
    ArgumentParseError,

    /// No deposit when expected.
    MissingDeposit,

    /// Insufficient funds to finish the operation.
    InsufficientFunds,

    /// U256 overflow.
    IntegerOverflow,

    /// Method not found.
    MethodNotFound,

    /// Invalid signature when recovering.
    InvalidEcRecoverSignature,

    /// Invalid nonce.
    InvalidNonce,

    /// Invalid sub EVM account.
    InvalidSubAccount,

    /// Won't withdraw to itself.
    FailSelfWithdraw,

    /// Too small NEAR deposit.
    InsufficientDeposit,

    /// `OutOfGas` is returned when transaction execution runs out of gas.
    /// The state should be reverted to the state from before the
    /// transaction execution. But it does not mean that transaction
    /// was invalid. Balance still should be transfered and nonce
    /// should be increased.
    OutOfGas,

    /// `BadJumpDestination` is returned when execution tried to move
    /// to position that wasn't marked with JUMPDEST instruction
    BadJumpDestination {
        /// Position the code tried to jump to.
        destination: u64,
    },

    /// `BadInstructions` is returned when given instruction is not supported
    BadInstruction {
        /// Unrecognized opcode
        instruction: u8,
    },

    /// `StackUnderflow` when there is not enough stack elements to execute instruction
    StackUnderflow {
        /// Invoked instruction
        instruction: String,
        /// How many stack elements was requested by instruction
        wanted: u64,
        /// How many elements were on stack
        on_stack: u64,
    },

    /// When execution would exceed defined Stack Limit
    OutOfStack {
        /// Invoked instruction
        instruction: String,
        /// How many stack elements instruction wanted to push
        wanted: u64,
        /// What was the stack limit
        limit: u64,
    },

    /// Built-in contract failed on given input
    BuiltIn(String),

    /// When execution tries to modify the state in static context
    MutableCallInStaticContext,

    /// Out of bounds access in RETURNDATACOPY.
    OutOfBounds,

    /// Execution has been reverted with REVERT.
    Reverted,

    /// Invalid method name to parse
    InvalidMetaTransactionMethodName,

    /// Invalid function args in meta txn
    InvalidMetaTransactionFunctionArg,

    /// Chain ID doesn't match. Trying to use transaction signed for a different chain.
    InvalidChainId,
}

pub enum VMLogicError {

    /// Errors coming from native Wasm VM.
    HostError(HostError),

    /// Serialized external error from External trait implementation.
    ExternalError(Vec<u8>),

    /// An error that is caused by an operation on an inconsistent state.
    InconsistentStateError(InconsistentStateError),

    /// An error coming from native EVM.
    EvmError(EvmError),
}

pub enum InconsistentStateError {
    StorageError(String),

    /// Math operation with a value from the state resulted in a integer overflow.
    IntegerOverflow,
}
